var lmj = require("crypto-js")

f = lmj.enc.Utf8.parse("jo8j9wGw%6HbxfFn");
m = lmj.enc.Utf8.parse("0123456789ABCDEF");
function h(t) {
            var e = lmj.enc.Hex.parse(t)
              , n = lmj.enc.Base64.stringify(e)
              , a = lmj.AES.decrypt(n, f, {
                iv: m,
                mode: lmj.mode.CBC,
                padding: lmj.pad.Pkcs7
            })
              , r = a.toString(lmj.enc.Utf8);
            return r.toString()
}

res = h(data="")

console.log(res)